import React from 'react';
import $ from 'jquery';
import monkey from '../../assets/monkey.png';
import doge from '../../assets/doge.png'; // TODO: Replace doge with something more suitable. Might be fine though, because everybody likes dogs.

function reloadPage() {
  window.location.reload();
}

export default class Main extends React.Component {
  componentDidMount() {
    $('#main').hide();
    $('#error').hide();
    $('body').css('background', '#173a64');
    // let isOnline = true;
    // eslint-disable-next-line promise/catch-or-return
    fetch(`https://mastodon.social/api/v1/instance?d=${Date.now()}`)
      .then((response) => {
        // eslint-disable-next-line promise/always-return
        if (!response.ok) {
          // isOnline = false;
        }
      })
      .catch(() => {
        $('#loading').hide();
        $('#error').show();
        window.setInterval(() => {
          $('#main').hide();
          $('body').css('background', '#173a64');
        });
      });
    window.setTimeout(function () {
      try {
        $.get(
          'https://api.openweathermap.org/data/2.5/weather?q=Rendsburg&units=metric&appid=735f03336131c3e5700d4e07662d570c',
          function (data: { main: { temp: number } }) {
            $('#temperature').html(String(Math.round(data.main.temp)));
          }
        );
      } catch (e) {
        console.log(e);
      }
    });
    window.setTimeout(() => {
      $('#loading').hide();
      $('#main').show();
      $('body').css('background', `#fff`);
      const isTeacher = true;
      const links = {
        schulcloud: {
          icon: 'data:image/svg+xml;base64,',
          // icon: "",
          url: 'https://app.schul.cloud/app#/chats',
          teacher: false,
          enabled: true,
        },
        portal: {
          // icon: 'https://c.tenor.com/wE_qxJqpxj0AAAAd/nether-portal-minecraft.gif',
          icon: 'https://codebrightly.com/wp-content/uploads/2020/04/Moodle.png',
          url: 'https://portal.bbz-rd-eck.com',
          teacher: false,
          enabled: true,
        },
        msoffice: {
          icon: 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5f/Microsoft_Office_logo_%282019%E2%80%93present%29.svg/2048px-Microsoft_Office_logo_%282019%E2%80%93present%29.svg.png',
          url: 'https://www.office.com/?auth=2',
          teacher: false,
          enabled: true,
        },
        onlyoffice: {
          icon: 'https://download.onlyoffice.com/assets/fb/fb_icon_325x325.jpg',
          url: 'https://personal.onlyoffice.com/products/files',
          teacher: true,
          enabled: false,
        },
        whiteboardteam: {
          icon: 'data:image/png;base64,',
          url: 'https://excalidraw.com',
          teacher: true,
          enabled: true,
        },
        onenote: {
          icon: 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/10/Microsoft_Office_OneNote_%282019%E2%80%93present%29.svg/2203px-Microsoft_Office_OneNote_%282019%E2%80%93present%29.svg.png',
          url: 'https://www.onenote.com/notebooks?auth=2&nf=1',
          teacher: false,
          enabled: true,
        },
        miro: {
          icon: 'https://albionacademy.de/wp-content/uploads/2021/05/Miro-Logo.png',
          url: 'https://miro.com/app/dashboard/',
          teacher: true,
          enabled: true,
        },
        owa: {
          icon: 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/df/Microsoft_Office_Outlook_%282018%E2%80%93present%29.svg/2203px-Microsoft_Office_Outlook_%282018%E2%80%93present%29.svg.png',
          url: 'https://exchange.bbz-rd-eck.de/owa/#path=/mail',
          teacher: true,
          enabled: true,
        },
        untis: {
          icon: 'https://www.untis.at/fileadmin/user_upload/UntisMobile_Icon.png',
          url: 'https://neilo.webuntis.com/WebUntis/?school=bbz-rd-eck#/basic/login',
          teacher: false,
          enabled: true,
        },
        plagscan: {
          icon: 'data:image/png;base64,',
          url: 'https://my.plagaware.com/dashboard',
          teacher: true,
          enabled: true,
        },
        univention: {
          icon: 'data:image/svg+xml;base64,',
          url: 'https://portal.schule-sh.de/univention/portal/',
          teacher: true,
          enabled: true,
        },
        kurzelinks: {
          icon: 'https://www.freeiconspng.com/uploads/link-icon-png-14.png',
          url: 'https://kurzelinks.de',
          teacher: true,
          enabled: true,
        },
        handbuch: {
          icon: 'https://icon-library.com/images/user-manual-icon/user-manual-icon-25.jpg',
          url: 'https://portal.bbz-rd-eck.com/course/view.php?id=108',
          teacher: true,
          enabled: true,
        },
      };
      // eslint-disable-next-line no-restricted-syntax
      for (const [key, e] of Object.entries(links)) {
        if (e.enabled) {
          if (e.teacher === true && isTeacher === true) {
            $('#apps').append(
              `<a onClick="changeUrl('${key}')" target="_blank" class="link-${key} app" style="cursor:pointer;"><img src="${e.icon}" height="24"></a>`
            );
            $('#views').append(
              `<webview
              id="wv-${key}"
              class="wv web-${key}"
              src="${e.url}"
              style="display:inline-flex;width:100%;height:89.5vh;"
              allowpopups></webview>`
            );
          }
          if (e.teacher === false) {
            $('#apps').append(
              `<a onClick="changeUrl('${key}')" target="_blank" class="link-${key} app" style="cursor:pointer;"><img src="${e.icon}" height="24"></a>`
            );
            $('#views').append(
              `<webview
              id="wv-${key}"
              class="wv web-${key}"
              src="${e.url}"
              style="display:inline-flex; width:100%; height:89.5vh;"
              allowpopups></webview>`
            );
          }
          $('#buttons').append(
            `<span onClick="reloadView('${key}')" class="wvbr webbr-${key}" style="cursor:pointer;"><img height="22" style="vertical-align:middle;" src="data:image/svg+xml;base64,"></span>`
          );
          $('#buttons').append(
            `<span onClick="back('${key}')" class="wvbb webbb-${key}" style="cursor:pointer;vertical-align:middle;font-size:22pt;font-weight:bold;margin-left:10px;">&larr;</span>`
          );
          $('#buttons').append(
            `<span onClick="forward('${key}')" class="wvbf webbf-${key}" style="cursor:pointer;vertical-align:middle;font-size:22pt;font-weight:bold;margin-left:10px;">&rarr;</span>`
          );
          $('.wv').hide();
          $('.wvbr').hide();
          $('.wvbb').hide();
          $('.wvbf').hide();
        }
      }
    }, 3000);

    document.addEventListener('keydown', (event) => {
      if (event.ctrlKey && event.keyCode === 32) {
        $('#doge').html(
          '<video src="https://f001.backblazeb2.com/file/koyuspace-media/cache/media_attachments/files/108/216/721/989/948/797/original/4523bd1f0de68193.mp4" width="640" height="480" autoplay></video>'
        );
      }
    });
  }

  render() {
    return (
      <div>
        <div id="main">
          <header>
            <div id="container">
              <div id="headnote">
                <p>
                  <img
                    src="https://www.bbz-rd-eck.de/wp-content/uploads/2018/09/BBZ-Logo-Master.png"
                    alt="BBZ Logo"
                    height="32"
                    id="logo"
                  />
                  <h1>BBZ Cloud</h1>
                </p>
                <p>
                  In Rendsburg-Eckernförde sind es aktuell{' '}
                  <span id="temperature" />
                  °C
                </p>
              </div>
              <div id="apps" />
              <div id="buttons" />
              <br />
            </div>
          </header>
          <div id="content">
            <div id="views" />
            <div id="doge">
              <img style={{ marginLeft: '120px' }} src={doge} alt="Doge" />
            </div>
          </div>
        </div>
        <div id="loading">
          <span className="loader" />
          <p>
            <small style={{ color: '#fff' }}>Lädt...</small>
          </p>
        </div>
        <div id="error">
          <img
            src={monkey}
            height="90"
            alt="monkey"
            style={{ cursor: 'pointer' }}
            onClick={reloadPage}
            onKeyDown={reloadPage}
          />
        </div>
      </div>
    );
  }
}
